import Link from "../Link/Link";

const Navbar = (props) => {
  const navItems = [
    {
      id: 1,
      navLabel: "Home",
      navUrl: "#",
    },
    {
      id: 2,
      navLabel: "About",
      navUrl: "#",
    },
    {
      id: 3,
      navLabel: "Service",
      navUrl: "#",
    },
    {
      id: 4,
      navLabel: "Features",
      navUrl: "#",
    },
    {
      id: 5,
      navLabel: "Contact Us",
      navUrl: "#",
    },
  ];
  return (
    <nav>
      <div className="navigation">
        <a
          href={props.brandLink}
          className={props.className}
          style={props.style}
        >
          {(props.brandName && <h1>{props.brandName}</h1>) || (
            <img
              src={props.brandImage}
              alt={props.brandName}
              style={props.imgStyle}
            />
          )}
        </a>
        <div className="menu-item">
          <ul>
            {navItems.map((item, index) => {
              return (
                <Link
                  key={item.id}
                  url={item.navUrl}
                  linkText={item.navLabel}
                  className="nav-item"
                />
              );
            })}
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
